import React from 'react';
import Banner from './Banner';
import FundraiserCard from './FundraiserCard';
import ButtonCenter from './ButtonCenter';
import Berita from './Berita';
import Berita3 from './Berita3';


const App = () => {
  return (
    <div>
      <Banner />
      <FundraiserCard />
      <ButtonCenter />
      <Berita />
      <Berita3 />
    </div>
  );
};

export default App;
